import React, { Component } from 'react'
import "./App.css";

export default class Home extends Component {
  render() {
    return (
        <div className='products'>
        <img className='productimg' src={this.props.setPaint} alt="Paint/" /> 
        <h1 className="productname">{this.props.setPainters}</h1>
        <p className="productprice">${this.props.setPaintPrice}</p>
        </div>
    )
  }
}
